import React from 'react';

function App() {
  return (
    <div style={{ padding: '20px', fontFamily: 'Arial' }}>
      <h1>UbiIntern Automation Platform</h1>
      <div style={{ marginTop: '20px' }}>
        <h2>System Status:</h2>
        <p>✓ Frontend Running</p>
        <p>⏳ Backend Connecting...</p>
        <p>⏳ Database Loading...</p>
      </div>
      <div style={{ marginTop: '20px' }}>
        <button 
          style={{ padding: '10px 20px', marginRight: '10px', backgroundColor: '#007bff', color: 'white', border: 'none', borderRadius: '5px' }}
          onClick={() => alert('Employee Login - Coming Soon')}
        >
          Employee Sign-In
        </button>
        <button 
          style={{ padding: '10px 20px', backgroundColor: '#28a745', color: 'white', border: 'none', borderRadius: '5px' }}
          onClick={() => alert('Customer Portal - Coming Soon')}
        >
          Customer Portal
        </button>
      </div>
    </div>
  );
}

export default App;
